    [],nt"revision_timestamp": "2014-11-25T23:58:53.288796",nt"name": "mean-annual-water-budget-components-for-the-island-of-maui-hawaii-1978-2007",nt"isopen":
    false,nt"url": null,nt"notes": "The shapefile associated with this metadata
    file represents the spatial distribution of mean annual water-budget components,
    in inches, for the Island of Maui, Hawaii. The water-budget components in the shapefile
    were computed by a water-budget model for a scenario representative of average climate
    conditions (1978u00e2u0080u00932007 rainfall) and 2010 land cover, as described
    in USGS SIR 2014-5168. The model was developed for estimating groundwater recharge
    and other water-budget components for each subarea of the model. The model subareas
    were generated using Esri ArcGIS software by intersecting (merging) multiple spatial
    data sets that characterize the spatial distribution of rainfall, fog interception,
    irrigation, reference evapotranspiration, direct runoff, soil type, and land cover.
    This metadata file describes the process of merging these spatial data sets into
    318,429 model subareas, which are represented by the polygons in the shapefile.
    These spatial data sets characterize the spatial distribution of hydrologic and
    physical conditions that the model uses to compute groundwater recharge and other
    water-budget components. The shapefile attribute information associated with each
    polygon present an estimate of mean annual rainfall, fog interception, septic-system
    leachate, runoff, canopy evaporation, net precipitation, total evapotranspiration,
    recharge, and seepage from reservoirs and cesspools. This shapefile also includes
    select geographic and land-cover attributes of the model subareas. Brief descriptions
    of the water-budget components and attributes are included in this metadata file.
    Refer to USGS SIR 2014-5168 for further details of the methods and sources used
    to determine these components and attributes.",nt"license_title": null,nt"extras":
